import {Header} from './Header';
import {Footer} from './Footer';

export function CartPage(){
    return(
        <div className={styles.wrapper}>
            <Header/>
            <div className={styles.content}>
                <div className="nav">

                </div>
                <div className="cart">
                    <div className={styles.cardContainer}>

                    </div>
                    <div className="details">

                    </div>
                </div>
            </div>
            <Footer/>
        </div>
    );
}
